INSERT INTO `nhasanxuat` (`ma_nsx`, `ten_nsx`, `thongtin`) VALUES
(1, 'Apple', 'Apple Inc. là một tập đoàn công nghệ máy tính của Mỹ có trụ sở chính đặt tại Cupertino, California. Apple được thành lập ngày 1 tháng 4 năm 1976 dưới tên Apple Computer, Inc., và đổi tên thành Apple Inc. vào đầu năm 2007.'),
(2, 'Samsung', 'Tập đoàn Samsung, là một tập đoàn đa quốc gia của Hàn Quốc có tổng hành dinh đặt tại Samsung Town, Seoul. Tập đoàn sở hữu nhiều công ty con, hầu hết hoạt động dưới thương hiệu Samsung, là tập đoàn lớn nhất Hàn Quốc.'),
(3, 'Oppo', 'OPPO Electronics Corp. là nhà sản xuất thiết bị điện tử Trung Quốc, có trụ sở đặt tại Đông Hoản, Quảng Đông. OPPO cung cấp một số sản phẩm chính như máy nghe nhạc MP3, Tivi LCD, eBook, DVD/Blu-ray và điện thoại thông minh. Thành lập vào năm 2004, công ty '),
(4, 'Nokia', 'Nokia Corporation là một tập đoàn đa quốc gia có trụ sở tại Keilaniemi, Espoo, một thành phố láng giềng của thủ đô Helsinki, Phần Lan.'),
(5, 'Huawei', 'Huawei, tên đầy đủ là Công ty trách nhiệm hữu hạn Kỹ thuật Hoa Vị là một tập đoàn đa quốc gia về thiết bị mạng và viễn thông, có trụ sở chính tại Thâm Quyến, Quảng Đông, Trung Quốc. Huawei là nhà cung cấp thiết bị viễn thông lớn nhất thế giới.'),
(6, 'Xiaomi', 'Xiaomi Inc. là một công ty tư nhân sản xuất hàng điện tử Trung Quốc có trụ sở tại Bắc Kinh. Xiaomi là nhà sản xuất điện thoại thông minh lớn thứ 4 thế giới; trong năm 2015 Xiaomi đã bán 70,8 triệu đơn vị và chiếm gần 5% thị trường điện thoại thông minh th'),
(7, 'HTC', 'Tập đoàn HTC, viết tắt của High Tech Computer Corporation, mã giao dịch trên thị trường chứng khoán TAIEX: 2498, là tập đoàn sản xuất các thiết bị cầm tay của Đài Loan, có trụ sở tại quận Tân Điếm, Thành phố Tân Bắc, Đài Loan. Nổi tiếng với dòng sản phẩm '),
(8, 'Sony', 'Công ty công nghiệp Sony, gọi tắt là Sony, là một tập đoàn đa quốc gia của Nhật Bản, với trụ sở chính nằm tại Minato, Tokyo, Nhật Bản, và là tập đoàn điện tử đứng thứ 5 thế giới với 81,64 tỉ USD.');
